	(32, 2, 'brmilev22', 'Boris Milev\'s Portfolio', 'Software developer passionate about building great products.', 'Full-stack software engineer with extensive experience in web and mobile application development, focusing on creating user-friendly solutions across various platforms. Specializes in JavaScript, TypeScript, Swift, Java, HTML, and C++, leveraging these technologies to build scalable and efficient systems. Proven track record of leading feature development and maintaining high code quality across collaborative teams. Currently focused on enhancing developer productivity tools through the integration of modern technologies.', 0, 'dark', '2026-02-26 11:08:10', '2026-02-26 12:33:43', '2026-02-26 11:11:04');

