INSERT INTO `projects` (`id`, `portfolio_id`, `github_repo_id`, `name`, `description`, `ai_enhanced_description`, `url`, `languages`, `stars`, `forks`, `is_highlighted`, `display_order`, `created_at`, `updated_at`, `ai_enhanced_at`) VALUES
	(795, 32, '1031403752', 'AudioRescue', 'Developed a one-click macOS menu bar application in Swift to resolve common MacBook Pro/Air audio issues, including crackling and distortion.\nAutomated the execution of sudo killall coreaudiod command with user-friendly interface design, enhancing usability for non-technical users.\nDeployed the free and open-source solution, garnering 5 stars on GitHub for addressing widespread Mac audio problems.', NULL, 'https://github.com/BRMilev22/AudioRescue', '["Swift"]', 5, 0, 1, 0, '2026-02-26 15:17:40', '2026-02-26 15:17:56', NULL),
	(796, 32, '867532552', 'tasty', 'Built a cross-platform meal planning application using React Native and TypeScript, enabling users to create personalized meal plans.\nIntegrated barcode and receipt scanning features, allowing seamless tracking of grocery inventories and dietary intake.\nDeployed an AI-based recommendation engine that suggests recipes tailored to individual dietary preferences, garnering 4 stars on GitHub.', NULL, 'https://github.com/BRMilev22/tasty', '["TypeScript"]', 4, 1, 1, 1, '2026-02-26 15:17:40', '2026-02-26 15:17:50', NULL),
	(797, 32, '1018620640', 'DreamWeaver', 'Developed a sophisticated AI-driven narrative creation tool using Swift and SwiftUI, enabling users to generate compelling stories through advanced AI algorithms.\nIntegrated Supabase for real-time database interactions, enhancing user experience by providing seamless data synchronization across devices.\nImplemented story generation with OpenRouter DeepSeek and cover art generation with OpenAI, offering users an all-in-one solution for creative storytelling.\nDeployed the application on iOS, leveraging Swift’s capabilities to deliver a highly responsive and intuitive interface used by enthusiasts worldwide.\nGarnering 3 stars on GitHub, DreamWeaver demonstrates its potential in revolutionizing how creators approach story development through cutting-edge technology.', NULL, 'https://github.com/BRMilev22/DreamWeaver', '["Swift"]', 3, 0, 1, 2, '2026-02-26 15:17:40', '2026-02-26 15:18:08', NULL),
	(798, 32, '1029651889', 'live-weather-dashboard', 'Developed a live weather dashboard using TypeScript and React, integrating real-time weather data on an interactive map with Mapbox.\nEngineered dynamic visualizations using D3 and Chart.js to display temperature trends and other meteorological data in real time.\nDeployed the application on a Node.js backend to efficiently fetch and stream API data, garnering 2 stars on GitHub.', NULL, 'https://github.com/BRMilev22/live-weather-dashboard', '["TypeScript"]', 2, 0, 1, 3, '2026-02-26 15:17:40', '2026-02-26 15:17:53', NULL),
	(799, 32, '1139838542', 'Light-Monitor-95', 'Built a light-level monitoring system using HTML for the user interface, integrating seamlessly with Arduino hardware.\nIntegrated ROS2 middleware to enable advanced control features and data processing in a retro Windows 95-themed UI.\nDeployed the project on Flask, creating a web-based desktop environment that garnered 2 stars on GitHub.', NULL, 'https://github.com/BRMilev22/Light-Monitor-95', '["HTML"]', 2, 0, 1, 4, '2026-02-26 15:17:40', '2026-02-26 15:18:11', NULL),
	(800, 32, '1096465502', 'DBForge', 'DBForge is a cloud-based database platform that makes enterprise-grade databases accessible and affordable for students. Users can spin up various database instances (PostgreSQL, MySQL/MariaDB, MongoDB, etc.) and manage them through a browser-based DBMS with traditional client connection support.', NULL, 'https://github.com/BRMilev22/DBForge', '["TypeScript"]', 2, 0, 1, 5, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(801, 32, '1059700958', 'employee-api', 'Spring Boot REST API with JWT authentication, JPA/Hibernate ORM for database operations, MySQL database, comprehensive employee/department/position management, complete leave request workflow with document uploads, role-based security system, advanced search and filtering capabilities, and 100% integration test coverage across all features.', NULL, 'https://github.com/BRMilev22/employee-api', '["Java"]', 2, 0, 0, 6, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(802, 32, '1049725613', 'MockFlow', 'A comprehensive API mocking SaaS platform for developers, built with TypeScript, Next.js, Express, and MySQL/MariaDB.', NULL, 'https://github.com/BRMilev22/MockFlow', '["JavaScript"]', 2, 0, 0, 7, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(803, 32, '1062099240', 'e36-cluster-demo-arduino-uno-r3', 'BMW E36 instrument cluster demo with Arduino Uno R3. Generates authentic RPM (3 pulses/rev) and speed (9 pulses/diff rev) signals using proper BMW specifications. Features realistic driving simulation with smooth gear shifts, acceleration/deceleration cycles. No external software needed - pure Arduino code.', NULL, 'https://github.com/BRMilev22/e36-cluster-demo-arduino-uno-r3', '["C++"]', 2, 1, 0, 8, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(804, 32, '1030605700', 'MoodyChat', 'MoodyChat is a revolutionary iOS chat application that dynamically adapts its user interface based on the emotional sentiment of conversations. This proof of concept demonstrates advanced SwiftUI techniques, liquid glass aesthetics, and AI-powered emotional intelligence.', NULL, 'https://github.com/BRMilev22/MoodyChat', '["Swift"]', 2, 0, 0, 9, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(805, 32, '1028279046', 'smdragomanski-website', 'Dragomanski Construction Market is a state-of-the-art e-commerce platform designed specifically for Строителен Маркет Драгомански, a leading Bulgarian construction materials supplier with over 30 years of industry expertise.', NULL, 'https://github.com/BRMilev22/smdragomanski-website', '["TypeScript"]', 2, 0, 0, 10, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(806, 32, '1165725413', 'OpenFolio', NULL, NULL, 'https://github.com/BRMilev22/OpenFolio', '[]', 1, 0, 0, 11, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(807, 32, '1150817062', 'lidar-mb-1r2t_ft232rl', 'This project interfaces a Chinese MB-1R2T V1.5.8 2D LiDAR scanner with a computer via an FTDI FT232RL USB-to-Serial converter. The system enables real-time 360° environmental scanning with distance measurements up to 12 meters.', NULL, 'https://github.com/BRMilev22/lidar-mb-1r2t_ft232rl', '["Python"]', 1, 0, 0, 12, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(808, 32, '730105337', 'BRMilev22', 'Config files for my GitHub profile.', NULL, 'https://github.com/BRMilev22/BRMilev22', '[]', 1, 1, 0, 13, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(809, 32, '1008258815', 'abandoned-explorer', 'A comprehensive iOS app and API platform for discovering, documenting, and exploring abandoned locations across the United States. Abandoned Explorer is the ultimate urban exploration companion that combines a vast database of over 3,000 verified abandoned locations with social features, location discovery tools, and community-driven content.', NULL, 'https://github.com/BRMilev22/abandoned-explorer', '["Swift"]', 1, 0, 0, 14, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(810, 32, '1032864858', 'brmilev-dev-portfolio', 'Modern developer portfolio built with Next.js 14, TypeScript & Tailwind CSS. Features interactive animations and showcases 10+ full-stack projects across iOS, web & desktop platforms.', NULL, 'https://github.com/BRMilev22/brmilev-dev-portfolio', '["TypeScript"]', 1, 0, 0, 15, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(811, 32, '974684129', 'ChemEco', 'ChemEco is a modern, full-featured system for environmental issue reporting and tracking, developed as an educational project in chemistry and environmental protection. The system consists of three main components that work together to create a comprehensive solution.', NULL, 'https://github.com/BRMilev22/ChemEco', '["TypeScript"]', 1, 0, 0, 16, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(812, 32, '1017931131', 'Bookbite', 'A restaurant reservation system featuring MySQL/MariaDB database with C++ Backend API with CROW and modern web frontend + swiftui native iOS application', NULL, 'https://github.com/BRMilev22/Bookbite', '[]', 1, 0, 0, 17, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(813, 32, '987301125', 'dcat', 'DCat is a modern product catalog web application built with React, Node.js, and MySQL. Users can browse public listings, while admins log in to manage products (add/edit/delete), upload images, and complete full product details via secure JWT authentication.', NULL, 'https://github.com/BRMilev22/dcat', '["JavaScript"]', 1, 0, 0, 18, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(814, 32, '658745355', 'db-search', 'A .php website, which connects to a database and searches through it.', NULL, 'https://github.com/BRMilev22/db-search', '["PHP"]', 1, 0, 0, 19, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(815, 32, '731218370', 'NexGenBank', 'In this repository you can find our source code to our first school project (2023-2024), a revolutionizing banking innovation !', NULL, 'https://github.com/BRMilev22/NexGenBank', '["HTML"]', 1, 2, 0, 20, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
	(816, 32, '980707067', 'autodb', 'AutoDB is a full-stack web application for managing an auto parts inventory. It allows users to track parts, monitor stock levels, and manage inventory efficiently.', NULL, 'https://github.com/BRMilev22/autodb', '["JavaScript"]', 1, 0, 0, 21, '2026-02-26 15:17:40', '2026-02-26 15:17:40', NULL),
